//Close Modal
function closeModal() {
    $("#modalContent").html("");
    $("#divModal").modal("hide");
}

function ShowModal() {
    
    $("#divModal").modal({ backdrop: 'static', show: true, keyboard: false });

    $('.modal-dialog').draggable({
        handle: ".modal-header"
    });
}
function CustomModalClose(modelContent, divmodal) {
    $("#" + modelContent).html("");
    $("#" + divmodal).modal("hide");

}




